// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

import "./Owned.sol";
import "./Logger.sol";
import "./IFaucet.sol";

contract Faucet is Owned, Logger, IFaucet {
    // this is a special function 
    // that is called when you make a 
    // transaction (tx) that doesn't 
    // specify a function name to call

    // External functions are a part of 
    // the interface, which means they 
    // can be called via contracts and 
    // other txs

    // public -> can be accessible only
    // within the smart contract

    // internal -> can be accessible only
    // within the smart contract and also
    // derived smart contract.

    uint public numOfFunders;

    mapping(address => bool) public funders;
    mapping(uint => address) public lutFunders;



    modifier limitWithdraw(uint withdrawAmount) {
        require(
            withdrawAmount <= 100000000000000000, 
            "Cannot withdraw more than 0.1 ether"
        );
        _;
    }


    receive() external payable{}

    function emitLog() public override pure returns(bytes32){
        return "Hello World";
    }

    function addFunds() external payable {
        address funder = msg.sender;
        if(!funders[funder]){
            uint index = numOfFunders++;
            funders[funder] = true;
            lutFunders[index] = funder;
        }
    }

    function test1() external onlyOwner{

    }
    function test2() external onlyOwner{

    }

    function withdraw(uint withdrawAmount) external limitWithdraw(withdrawAmount) {
        payable(msg.sender).transfer(withdrawAmount);
    }

    function getAllFunders() external view returns (address[] memory) {
        address[] memory _funders = new address[](numOfFunders);
        for (uint i = 0; i < numOfFunders; i++) {
            _funders[i] = lutFunders[i];
        }
        return _funders;
    }


    function getFunderAtIndex(uint8 index) external view returns (address) {
        return lutFunders[index];
    }

}

